import { useState } from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { NavLink } from "react-router-dom";

function NavigationBar() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <Navbar expand="lg" style={{ backgroundColor: "#222222" }}>
      <Container>
        {/* Кнопка с анимированным бургером */}
        <Navbar.Toggle
          aria-controls="basic-navbar-nav"
          className="custom-toggler ms-auto"
          onClick={() => setIsOpen(!isOpen)}
        >
          <svg
            width="36"
            height="28"
            viewBox="0 0 36 28"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            {/* Верхняя линия */}
            <path
              d="M2 2H34"
              stroke="#AEB3AA"
              strokeWidth="3.5"
              strokeLinecap="round"
              className={`top-line ${isOpen ? "open" : ""}`}
            />
            {/* Средняя линия */}
            <path
              d="M2 14H34"
              stroke="#AEB3AA"
              strokeWidth="3.5"
              strokeLinecap="round"
              className={`middle-line ${isOpen ? "open" : ""}`}
            />
            {/* Нижняя линия */}
            <path
              d="M2 26H34"
              stroke="#AEB3AA"
              strokeWidth="3.5"
              strokeLinecap="round"
              className={`bottom-line ${isOpen ? "open" : ""}`}
            />
          </svg>
        </Navbar.Toggle>

        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="w-100 justify-content-center">
            <Nav.Link as={NavLink} to="/" exact>
              Home
            </Nav.Link>
            <Nav.Link as={NavLink} to="/detail" exact>
              Detail
            </Nav.Link>
            <Nav.Link as={NavLink} to="/" exact>
              Home
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavigationBar;
